import React from 'react';
//import { Button} from 'react-bootstrap'

const STYLES = [
    'btn--primary',
    'btn--outline'

]

const SIZES =[
        'btn--primary',
        'btn--large'
]

export const Button = ({
    children,
    type,
    onclick,
    buttonStyle,
    buttonSize
}) => {

    const checkButtonStyle = STYLES.includes(buttonStyles) ? buttonStyle : STYLE[0]

    const checkButtonSIZE = STYLES.includes(buttonSize) ? buttonSize : SIZES[0]

    return (
        <button className={ 'btn ${checkButtonStyle}$ {checkButtonSIZE}'} onclick={onClick} type={type}>
            {children}
        </button>

    )

}
